import React, {Component} from 'react'
import xlsx from 'node-xlsx';
const workSheetsFromFile = xlsx.parse(`${__dirname}/components/myFile.xlsx`);
class Dep extends Component{
  render() {
    return(
      <div>{workSheetsFromFile}</div>
    )
  }
}



export default Dep
